import './App.css';
import MainPageComponent from "./main/index.js"
import {Switch, Route} from 'react-router-dom';
import UploadPage from "./upload";
import ProductPage from "./product";

function App() {
  return <div>
    <Switch>
      <Route path="/">
        <MainPageComponent />
      </Route>
      <Route path="/product">
        <ProductPage />
      </Route>
      <Route path="/upload">
        <UploadPage />
      </Route>
    </Switch>
    </div>;
}

export default App;
